import { Link } from "react-router-dom";

const Navbar = ({loggedIn}) => {
    return (
        <div>
                <nav>
                    <div>
                        <Link to="/">Home</Link>
                    </div>
                    <div>
                        <Link to="login">Login</Link>
                    </div>
                </nav>
        </div>
    )
}
export default Navbar
